import { useState, useEffect } from "react";

function App() {
  const [loading, setLoading] = useState(true);
  const [rockets, setRocket] = useState([]);

  const getRockets = async () => {
    const json = await (
      await fetch("https://api.spacexdata.com/v3/rockets")
    ).json();
    console.log(json);
    setRocket(json);
    setLoading(false);
  }
  useEffect(() => {
    getRockets();
  }, []);

